.github-RemotePrController {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-PrInfo {
  padding: 20px;
  overflow: auto;
  flex: 1;
  cursor: default;
}
.github-PrInfo .icon {
  vertical-align: middle;
}
.github-PrInfo .pinned-by-url {
  cursor: pointer;
}
.github-PrInfo .pinned-pr-info {
  display: flex;
  padding: 10px;
  border: 1px solid rgba(251, 241, 199, 0.35);
  border-radius: 0.125rem;
  margin-bottom: 20px;
}
.github-PrInfo .pinned-pr-info a {
  text-decoration: underline;
}
.github-PrInfo .pr-badge-and-link {
  display: flex;
  align-items: center;
  margin-bottom: 20px;
}
.github-PrInfo .pr-badge-and-link .browser-link {
  display: inline-block;
  margin-left: 0.5em;
}
.github-PrInfo .pr-badge {
  align-self: flex-start;
  flex-shrink: 0;
  margin-right: 10px;
  font-weight: bold;
  text-transform: capitalize;
  border-radius: 0.125rem;
}
.github-PrInfo .pr-badge.open {
  color: white;
  background-color: #28a745;
}
.github-PrInfo .pr-badge.closed {
  color: white;
  background-color: #dc3545;
}
.github-PrInfo .pr-badge.merged {
  color: white;
  background-color: #6f42c1;
}
.github-PrInfo .pr-link a {
  color: rgba(251, 241, 199, 0.35);
  word-break: break-all;
}
.github-PrInfo .pr-avatar-and-title {
  display: flex;
  align-items: center;
  margin-bottom: 10px;
}
.github-PrInfo .author-avatar-link {
  margin-right: 10px;
  align-self: flex-start;
}
.github-PrInfo .author-avatar {
  max-height: 32px;
  border-radius: 0.125rem;
}
.github-PrInfo .pr-title {
  margin: 0;
  line-height: 1.2;
  color: #fbf1c7;
}
.github-PrInfo .merge-status,
.github-PrInfo .build-status {
  line-height: 2;
}
.github-PrInfo .merge-status.success .icon {
  color: #8BC34A;
}
.github-PrInfo .build-status.pending .icon {
  color: #FFCA28;
}
.github-PrInfo .count-number {
  margin-left: .25em;
  font-size: 1.1em;
  font-weight: 600;
  line-height: 1;
}
.github-PrInfo .label {
  padding: 0 5px;
  margin: 0 5px 5px 0;
  border-radius: 0.125rem;
  line-height: 2em;
  display: inline-block;
}
.github-PrInfo .reactions .reaction-group {
  margin-right: 20px;
}
.github-PrInfo .meta-info,
.github-PrInfo .conversation,
.github-PrInfo .commit-count,
.github-PrInfo .file-count,
.github-PrInfo .reactions,
.github-PrInfo .labels {
  border-top: 1px solid transparent;
  padding: 10px 0;
}
.github-PrInfo .conversation {
  cursor: pointer;
}
